   method PopXMLFileToTab();

   method PrintBIPubRpt();

   method SetPDFDocPassWord();

private

   instance string &Str_Emplid;
   instance Rowset &Rs_X_PERS_INFO;

   instance string &Str_FQ_Filename_Path;
   instance string &Str_Filename;

   instance PSXP_RPTDEFNMANAGER:ReportDefn &BI_Pub_Rpt;

