method PrintBIPubRpt


   Local string &Str_Template_ID = "X_PT3_PDFSEC_1";

   &BI_Pub_Rpt.SetRuntimeDataXMLFile(&Str_FQ_Filename_Path);
   &BI_Pub_Rpt.ProcessReport(&Str_Template_ID, "", %Date, "");
   CommitWork();
   &BI_Pub_Rpt.DisplayOutput();

end-method;

method X_PT3_Pers_Info_Report
   /+ &In_Emplid as String +/

   &Str_Emplid = &In_Emplid;
   &Rs_X_PERS_INFO = CreateRowset(Record.X_PERS_INFO);

   &Rs_X_PERS_INFO.Fill("where emplid = :1", &Str_Emplid);


   &BI_Pub_Rpt = create PSXP_RPTDEFNMANAGER:ReportDefn("X_PT3_PDFSEC");
   &BI_Pub_Rpt.Get();

end-method;

method GenXmlFile

   &Str_Filename = "Pers_Report_" | &Str_Emplid | ".xml";

   Local PSXP_XMLGEN:RowSetDS &oXML_GENERATOR = create psxp_xmlgen:RowSetDS();

   Local string &XML_String = &oXML_GENERATOR.getXMLData(&Rs_X_PERS_INFO, "");

   Local File &XML_File = GetFile(&Str_Filename, "W", "UTF8");
   &XML_File.WriteLine(&XML_String);

   /* save file name and path for publishing */
   &Str_FQ_Filename_Path = &XML_File.Name;
   &XML_File.Close();

end-method;

method PopXMLFileToTab

   Local integer &retcode1, &retcode2, &retcode3;

   /* put the file in a URL (table) for easy presentation by the App Server */
   &retcode1 = PutAttachment(URL.FILEDB_XMLP, &Str_Filename, &Str_FQ_Filename_Path);

   CommitWork();
   /* ViewAttachment pops to new window if you want or opens program */
   &retcode2 = ViewAttachment(URL.FILEDB_XMLP, &Str_Filename, &Str_Filename);

   /* clean up the temp table when done */
   &retcode3 = DeleteAttachment(URL.FILEDB_XMLP, &Str_Filename);

end-method;



